            "description": "We know that emojis can’t express all your feelings, so… Meet Smileys! AMAZING emoticons app with a lot of funny, colorful and unique smiley faces!\r\n\r\n• 1000+ smileys and emoticons you can share with your friends!\r\n• Facebook, Messenger, WhatsApp and even more compatible apps!\r\n• Custom Keyboard for your device with all your Favorite smileys included\r\n• Colorful and friendly interface\r\n• Purchasable extra-packs with even more smileys!\r\n• Hundreds of hearts, signs, cute animals and even birthday wishes :)\r\n\r\nYou can use your phone or tablet to quickly send smileys on Facebook or any other messenger. Nice and simple interface allows you to share your thoughts instantly, everywhere, with just 3 taps! Select any emoticon, choose where to post, tap on “Send”. That’s all!\r\n\r\nWhether it's Christmas, Valentine's Day or someone's birthday, now you have EASY and AWESOME way to compliment anyone, on every occasion. Everybody’s gonna love these cute smiley faces :)",
