            "description": "Play and express your love at the same time using Couple Sweets - Giver & Couple Sweets - Taker apps, whenever you are with your sweetheart.\r\n\r\nCompliment her/him for anything and give it a score. Set target score and reward for achieving the target score.\r\n\r\n\r\n** How to play with Couple Sweets apps:\r\n\r\n1. You install and run Couple Sweets - Giver app and your sweetheart installs and runs Couple Sweets - Taker app.\r\n\r\n2. Turn on NFC function in both devices. (For Couple Sweets - Taker app, NFC Read & Write Tags should be turned on.)\r\n\r\n3. Set target score, set reward or write a compliment with Couple Sweets - Giver app.\r\n\r\n4. Tag your device to sweetheart's device. Target score, reward or compliment is transferred to your sweetheart!\r\n\r\n(To tag, get close back sides of both devices.\r\n\r\nKeep the devices tagged until you hear a cute sound that indicates the transfer is complete.\r\n\r\nSome devices may take a longer time depending on the state of the device.)\r\n\r\n\r\n# Couple app, Relationship building, Encouragement",
